@caelebdressel makes waves by swimming to the beat of his own drum.

Throughout the summer we showed you how all of #TeamSpeedo #makewaves – through learn to swim programs, prioritizing diversity in swim, intuitive eating, and so much more. What #makewaves story stood out to you? 

Let us know in the comments below.

Name this print?? Wrong answers only. 🍍

@jessicalberto in our #VibinWithSpeedo Printed Tie Back One Piece

#SpeedoUSA #speedousaambassador

NEW #TEAMSPEEDO MEMBER ALERT! 🔥

@regansmith4 joins #TeamSpeedo following her return home. Regan has been a long-time advocate of #SpeedoUSA and wore the brand’s LZR Pure Intent suit when she broke her first world record in the 200m backstroke (2:03.3) and 4x100m medley relay (57.57) She wore the same suit, in a USA Federation print, at the Games as set an OR in the 100m backstroke semi-final on her way to qualifying for the final.

Join us as we welcome Regan to #makewaves with us!

@keeganknott shares her #makewaves story: "I leave my disability on land and swim fierce in the water."

Now, it's your turn. Share how you Make Waves by tagging @speedousa for a chance to swim some Speedo swag.

#TeamSpeedo #SpeedoUSA
